import React, { Component } from "react";
import { connect } from "react-redux";
import { getDocument } from "../actions/DocumentActions";
import { PropTypes } from "prop-types";
import Content from "./Content"
class Dashboard extends Component {
  constructor(props){
    super(props);
    this.state= {document:{topic:''}};
  }
  componentDidMount() {
    const { documentId } = this.props.match.params.documentId;
    this.props.getDocument(documentId, this.props.history);
  }

  render() {
    const { document } = this.state;
    return (
        <div className="container" id="contentboard"> 
          <div className="row">
            <div className="col-md-10">
              {document.map(document => (
                <Content key={document.documentId} document={document} />
              ))}
            </div>
          </div>
        </div>
    );
  }
}
Dashboard.propTypes = {
  document: PropTypes.object.isRequired,
  getDocument: PropTypes.func.isRequired
};

const mapStateToProps = state => ({
  document: state.document
});

export default connect(
  mapStateToProps,
  { getDocument }
)(Dashboard);
